import React from 'react';
import './App.css';
import TodoList from './components/TodoList';

import MapContainer from './components/tmap';

function App() {
  return (

    <div className="MainContainer">

    <div className='todo-app'>
      <TodoList />
    </div>
    <div className='map'>
    < MapContainer/>
    </div>

    </div>

  );
}

export default App;
